import React from 'react'

function Selection() {
    function customer(){
        alert('login form')
    }
    function washer(){
        alert('login link')
    }

    return (
        <div>
            <div>
               
                <button onClick={customer}><h1>Login as Customer</h1></button>
                <p>Create your Account </p>
            </div>
            <div>
            
                <button onClick={washer}> <h1>Login as Washer</h1></button>
                <p>Create your Account </p>

            </div>
        </div>
    )
}

export default Selection
